import React from "react";
import { View, Button, Text } from "react-native";
import StyleHeadr from "./StyleHeadr";

const Header = () => {
    return <View style ={StyleHeadr.header}>
         <View><Button title ="bacK" ></Button></View>
         <Text>1</Text>
         <Text>2</Text>
         <Text>3</Text>
    </View>
}

export default Header;
